						<p class="g-body ">
							In many respects, the aging of the world is a triumph of development. People are living
							longer, healthier lives and having fewer children as they get richer.
						</p>
						<p class="g-body ">
							The opportunity for many poorer countries is enormous. When birth rates fall, countries can
							reap a “demographic dividend,” when a growing share of workers and few dependents fuel
							economic growth. Adults with smaller families have more free time for education and
							investing in their children. More women tend to enter the work force, compounding the
							economic boost.
						</p>
						<p class="g-body ">
