								<p class="g-body ">
									Many of these demographic changes are already baked in: Most people who will be
									alive in 2050 have already been born.
								</p>
								<p class="g-body ">
									But predictions always involve uncertainty, and there is evidence that sub-Saharan
									African countries’ <a
										href="https://www.economist.com/middle-east-and-africa/2023/04/05/the-worlds-peak-population-may-be-smaller-than-expected">fertility
										rates are dropping even faster than</a> the U.N. projects — meaning that those
									African countries could be even better positioned in 2050 than currently expected.
								</p>
								<p class="g-body ">
									But without the right policies, a huge working-age population can backfire rather
									than lead to economic growth. If large numbers of young adults don’t have access to
									jobs or education, widespread youth unemployment can even threaten stability as
									frustrated young people turn to criminal or armed groups for better opportunities.
								</p>
								<p class="g-body ">
									“If you don’t have employment for those people who are entering the labor force,
									then it’s no guarantee that the demographic dividend is going to happen,” said
									Carolina Cardona, a health economist at Johns Hopkins University who works with the
									Demographic Dividend Initiative.
								</p>
								<p class="g-body ">
									East Asian countries that hit the demographic sweet spot in the last few decades had
									particularly good institutions and policies in place to take advantage of that
									potential, said Philip O’Keefe, who directs the Aging Asia Research Hub at the ARC
									Center of Excellence in Population Aging Research and previously led reports on
									aging in East Asia and the Pacific at the World Bank.
								</p>
								<p class="g-body ">
									Other parts of the world – some of Latin America, for example – had age structures
									similar to those East Asian countries’ but haven’t seen anywhere near the same
									growth, according to Mr. O’Keefe. “Demography is the raw material,” he said. “The
									dividend is the interaction of the raw material and good policies.”
								</p>
