								</div>
								<p class="g-body ">
									To cope, experts say, aging rich countries will need to rethink pensions,
									immigration policies and what life in old age looks like.
								</p>
								<p class="g-body ">
									Change will not come easy. More than a <a
										href="https://www.nytimes.com/2023/01/19/world/europe/france-strikes-macron-retirement-age.html">million</a>
									people have taken to the streets in France to protest <a
										href="https://www.nytimes.com/2023/04/06/world/europe/france-protests-pensions-macron.html">raising
										the retirement age</a> to 64 from 62, highlighting the difficult politics of
									adjusting. Immigration fears have fueled support for right-wing candidates across
									aging countries in the West and East Asia.
								</p>
								<p class="g-body ">
									“Much of the challenges at the global level are questions of distribution,” Dr.
									Myrskylä said. “So some places have too many old people. Some places have too many
									young people. It would of course make enormous sense to open the borders much more.
									And at the same time we see that’s incredibly difficult with the increasing
									right-wing populist movements.”
								</p>
								<p class="g-body ">
									The changes will be amplified in Asian countries, which are aging faster than other
									world regions, according to <a
										href="https://www.worldbank.org/en/publication/east-asia-and-pacific-economic-update">the
										World Bank</a>. A change in age structure that took France <a
										href="https://openknowledge.worldbank.org/server/api/core/bitstreams/7065093c-6b71-4037-ac32-9adb7f2fd85a/content">more
										than 100 years</a> and the United States more than 60 took many East and
									Southeast Asian countries just 20 years.
								</p>
								<p class="g-body ">
									Not only are Asian countries aging much faster, but some are also becoming old
									before they become rich. While Japan, South Korea and Singapore have relatively high
									income levels, China reached its peak working-age population at 20 percent the
									income level that the United States had at the same point. Vietnam reached the same
									peak at 14 percent the same level.
								</p>
								<p class="g-body ">
									Pension systems in lower-income countries are less equipped to handle aging
									populations than those in richer countries.
								</p>
								<p class="g-body ">
									In most lower-income countries, workers are not protected by a robust pension
									system, Mr. O’Keefe said. They rarely contribute a portion of their wages toward
									retirement plans, as in many wealthy countries.
								</p>
								<p class="g-body ">
									“That clearly is not a situation that’s going to be sustainable socially in 20
									years’ time when you have much higher shares of aged population,” he said.
									“Countries will have to sort out what model of a pension system they need to provide
									some kind of adequacy of financial support in an old age.”
								</p>
								<p class="g-body ">
									And some rich countries won’t face as profound a change — including the United
									States.
								</p>
								<p class="g-body ">
									Slightly higher fertility rates and more immigration mean the United States and
									Australia, for example, will be younger than most other rich countries in 2050. In
									both the United States and Australia, just under 24 percent of the population is
									projected to be 65 or older in 2050, according to U.N. projections — far higher than
									today, but lower than in most of Europe and East Asia, which will top 30 percent.
								</p>
								<p class="g-body ">
									Aging is a tremendous achievement despite its problems.
								</p>
								<p class="g-body ">
									“We’ve managed to increase the length of life,” Dr. Myrskylä said. “We have reduced
									premature mortality. We have reached a state in which having children is a choice
									that people make instead of somehow being coerced, forced by societal structures
									into having whatever number of children.”
								</p>
								<p class="g-body ">
									People aren’t just living longer; they are also living healthier, more active lives.
									And aging countries’ high level of development means they will continue to enjoy
									prosperity for a long time.
								</p>
								<p class="g-body ">
									But behavioral and governmental policy choices loom large.
								</p>
								<p class="g-body ">
									“You can say with some kind of degree of confidence what the demographics will look
									like,” Mr. O’Keefe said. “What the society will look like depends enormously on
									policy choices and behavioral change.”
								</p>

