							<div class="g-asset g-methodology">

								<p class="g-method-text g-method-heading">Methodology</p>


								<p class="g-method-text">Countries are categorized as having large working-age
									populations if people between the ages of 15 and 64, an age group commonly used by
									demographers, make up at least 65 percent of the total population.</p>

								<p class="g-method-text">Countries where at least a quarter of the population is under
									age 15 and where less than 65 percent of the population is working age are
									categorized as having a large young population. Countries are categorized as having
									a large old population if those age 65 and older make up more than a quarter of the
									population.</p>

								<p class="g-method-text">Unless noted otherwise, graphics include all countries with a
									population of at least 50,000 people.</p>

